import React from 'react'
import Records from './data.json'
import './styles/Afterlogin.css'

const Afterlogin = () => {
  return (
    <div>
        <div>
            Student
        </div>
        {
            Records.map(record =>{
                return(
                    <div className='table' key={record['Roll No']}>
                        {record.name} <br></br>
                        {record['Roll No']}<br></br>
                        {record.address}<br></br>
                        {record.institute}<br></br>
                        {record.course}<br></br>
                        
                    </div>
                )
            })
        }
    </div>
  )
}

export default Afterlogin
